import React from 'react';
import { NavLink } from 'react-router-dom';

const Menu = () => {
  return (
    <>
    <div className='menu_style'>
      <NavLink exact activeClassName ="active_nav" to="/">Home</NavLink> &nbsp; &nbsp;
      <NavLink exact activeClassName ="active_nav" to="/about">About</NavLink>
      <NavLink exact activeClassName ="active_nav" to="/user">User</NavLink>
      <NavLink exact activeClassName ="active_nav" to="/contact">Contact Me</NavLink>
    </div>
    </>
  )
}

export default Menu;
